const EMP_MAR12_NONPRDWRK_NUM = parseFloat(record['EMP_MAR12_NONPRDWRK_NUM'])
const PAY_QTR1_VAL = parseFloat(record['PAY_QTR1_VAL'])
const PAY_QTR1_PRDWRK_VAL = parseFloat(record['PAY_QTR1_PRDWRK_VAL'])
const PAY_QTR1_NONPRDWRK_VAL = parseFloat(record['PAY_QTR1_NONPRDWRK_VAL'])

if ((EMP_MAR12_PRDWRK_NUM + EMP_MAR12_NONPRDWRK_NUM == 0) && EMP_MAR12_NUM > 0) {
    if (PAY_ANN_PRDWRK_VAL > 0 && PAY_ANN_NONPRDWRK_VAL > 0 && PAY_ANN_VAL > 0) {
        record['EMP_MAR12_PRDWRK_NUM'] = Math.round((PAY_ANN_PRDWRK_VAL / PAY_ANN_VAL) * EMP_MAR12_NUM)
        record['EMP_MAR12_NONPRDWRK_NUM'] = Math.round((PAY_ANN_NONPRDWRK_VAL / PAY_ANN_VAL) * EMP_MAR12_NUM)
        record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'J');
        record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'J');
    } else if (PAY_QTR1_NONPRDWRK_VAL > 0 && PAY_QTR1_PRDWRK_VAL > 0 && PAY_QTR1_VAL > 0) {
        record['EMP_MAR12_PRDWRK_NUM'] = Math.round((PAY_QTR1_PRDWRK_VAL / PAY_QTR1_VAL) * EMP_MAR12_NUM)
        record['EMP_MAR12_NONPRDWRK_NUM'] = Math.round((PAY_QTR1_NONPRDWRK_VAL / PAY_QTR1_VAL) * EMP_MAR12_NUM)
        record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'J');
        record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'J');
    } else {
        record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'X');
        record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'X');
    }
} else if ((EMP_MAR12_NONPRDWRK_NUM + EMP_MAR12_PRDWRK_NUM > 0) && EMP_MAR12_NUM > 0) {
    if (EMP_MAR12_NONPRDWRK_NUM + EMP_MAR12_PRDWRK_NUM != EMP_MAR12_NUM) {
        if (EMP_MAR12_PRDWRK_NUM == 0 && (EMP_MAR12_NONPRDWRK_NUM < EMP_MAR12_NUM)) {
            record['EMP_MAR12_PRDWRK_NUM'] = EMP_MAR12_NUM - EMP_MAR12_NONPRDWRK_NUM
            record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'J');
        } else if (EMP_MAR12_NONPRDWRK_NUM == 0 && (EMP_MAR12_PRDWRK_NUM < EMP_MAR12_NUM)) {
            record['EMP_MAR12_NONPRDWRK_NUM'] = EMP_MAR12_NUM - EMP_MAR12_PRDWRK_NUM
            record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'J');
        } else if (.8 <= (EMP_MAR12_PRDWRK_NUM + EMP_MAR12_NONPRDWRK_NUM) / EMP_MAR12_NUM &&
            (EMP_MAR12_PRDWRK_NUM + EMP_MAR12_NONPRDWRK_NUM) / EMP_MAR12_NUM <= 1.2) {
            const TEMP_DET_TOT = EMP_MAR12_PRDWRK_NUM + EMP_MAR12_NONPRDWRK_NUM
            const TEMP_EMP_PRDWORK = Math.round((EMP_MAR12_PRDWRK_NUM / TEMP_DET_TOT) * EMP_MAR12_NUM)
            const TEMP_EMP_NONPRDWORK = Math.round((EMP_MAR12_NONPRDWRK_NUM / TEMP_DET_TOT) * EMP_MAR12_NUM)
            if (TEMP_EMP_PRDWORK + TEMP_EMP_NONPRDWORK == EMP_MAR12_NUM) {
                record['EMP_MAR12_NONPRDWRK_NUM'] = TEMP_EMP_NONPRDWORK
                record['EMP_MAR12_PRDWRK_NUM'] = TEMP_EMP_PRDWORK
            } else if (TEMP_EMP_PRDWORK > TEMP_EMP_NONPRDWORK) {
                record['EMP_MAR12_PRDWRK_NUM'] = TEMP_EMP_PRDWORK + Math.round(EMP_MAR12_NUM - TEMP_EMP_NONPRDWORK)
                record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'K');
            } else {
                record['EMP_MAR12_NONPRDWRK_NUM'] = TEMP_EMP_NONPRDWORK + Math.round(EMP_MAR12_NUM - TEMP_EMP_PRDWORK)
                record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'K');
            }
        } else {
            record['EMP_MAR12_PRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_PRDWRK_NUM_F'], 2, 'X');
            record['EMP_MAR12_NONPRDWRK_NUM_F'] = setCharAt(record['EMP_MAR12_NONPRDWRK_NUM_F'], 2, 'X');
        }
    }
}

