    let record = msg.payload.csv[record_idx];
    let ec = msg.payload.tables.ec.find(obj => obj.fact.REPORTING_ID == record.REPORTING_ID)

    function setCharAt(str, index, chr) {
        if ([null, undefined].includes(str)) {
            let newstr = ''
            for (let i = 0; i < index; i++) {
                newstr = newstr + '_';
            }
            newstr = newstr + chr
            return newstr;
        } else {
            if (index > str.length - 1) {
                let addstr = index - str.length
                let newstr = str
                for (let i = 0; i < addstr; i++) {
                    newstr = newstr + '_';
                }
                newstr = newstr + chr
                return newstr;
            } else {
                return str.substring(0, index) + chr + str.substring(index + 1);
            }
        }
    }

    function flagRules(variable, details) {
        let flagname = variable + '_F'
        if (record?.[variable] == 0) {
            record[flagname] = setCharAt(record?.[flagname], 2, 'Z');
        } else {
            let found = 'N'
            for (let i in details) {
                let detail = details[i]
                if (record?.[detail]) {
                    if (['R_', 'K_', 'T_'].includes(record?.[detail].substring(0, 2))) {
                        found = 'Y'
                    } else if (['R', 'C', 'A', 'S', 'O', 'G'].includes(record?.[detail]?.charAt(1))) {
                        found = 'Y'
                    } else {
                        found = 'N'
                        break
                    }
                    // } else {
                    //     found = 'N'
                    //     break
                }
            }
            if (found == 'Y') {
                record[flagname] = setCharAt(record?.[flagname], 2, 'Y');
            } else {
                record[flagname] = setCharAt(record?.[flagname], 2, 'S');
            }
        }
    }
    function EvaluateDetailValuationMethods(variable) {
        let avg = ''
        let avg_f = ''
        let fifo = ''
        let fifo_f = ''
        let std = ''
        let std_f = ''
        let othnl = ''
        let othnl_f = ''
        let ival_tot = ''
        let ival_tot_f = ''
        let nl_tot = ''
        let nl_tot_f = ''
        let lifo = ''
        let lifo_f = ''
        let ec_std = ''
        let ec_avg = ''
        let ec_fifo = ''
        let ec_ival_tot = ''
        let INVVSUMx = msg.invvsumx
        let INVDIFFx = msg.invdiffx

        if (variable == 'E') {
            avg = 'INV_E_AVG_VAL'
            avg_f = 'INV_E_AVG_VAL_F'
            fifo = 'INV_E_FIFO_VAL'
            fifo_f = 'INV_E_FIFO_VAL_F'
            std = 'INV_E_STD_VAL'
            std_f = 'INV_E_STD_VAL_F'
            othnl = 'INV_E_OTHNL_VAL'
            othnl_f = 'INV_E_OTHNL_VAL_F'
            ival_tot = 'INV_E_IVAL_TOT_DVAL'
            ival_tot_f = 'INV_E_IVAL_TOT_DVAL_F'
            nl_tot = 'INV_E_NL_TOT_DVAL'
            nl_tot_f = 'INV_E_NL_TOT_DVAL_F'
            lifo = 'INV_E_LIFO_VAL'
            lifo_f = 'INV_E_LIFO_VAL_F'
            ec_std = 'INV_E_STD_VAL'
            ec_avg = 'INV_E_AVG_VAL'
            ec_fifo = 'INV_E_FIFO_VAL'
            ec_ival_tot = 'INV_E_IVAL_TOT_DVAL'
        } else if (variable == 'B') {
            avg = 'INV_B_AVG_VAL'
            avg_f = 'INV_B_AVG_VAL_F'
            fifo = 'INV_B_FIFO_VAL'
            fifo_f = 'INV_B_FIFO_VAL_F'
            std = 'INV_B_STD_VAL'
            std_f = 'INV_B_STD_VAL_F'
            othnl = 'INV_B_OTHNL_VAL'
            othnl_f = 'INV_B_OTHNL_VAL_F'
            ival_tot = 'INV_B_IVAL_TOT_DVAL'
            ival_tot_f = 'INV_B_IVAL_TOT_DVAL_F'
            nl_tot = 'INV_B_NL_TOT_DVAL'
            nl_tot_f = 'INV_B_NL_TOT_DVAL_F'
            lifo = 'INV_B_LIFO_VAL'
            lifo_f = 'INV_B_LIFO_VAL_F'
            ec_std = 'INV_B_STD_VAL'
            ec_avg = 'INV_B_AVG_VAL'
            ec_fifo = 'INV_B_FIFO_VAL'
            ec_ival_tot = 'INV_B_IVAL_TOT_DVAL'
        }

        if (parseFloat(record?.[lifo]) == 0) {
            if (parseFloat(INVVSUMx) == 0) {
                if (parseFloat(ec?.[ec_ival_tot]) == 0) {
                    msg.mivDetail = 'Call Random'
                } else {
                    record[fifo] = Math.round((parseFloat(ec?.[ec_fifo]) / parseFloat(ec?.[ec_ival_tot])) * parseFloat(record?.[ival_tot]))
                    record[fifo_f] = setCharAt(record?.[fifo_f], 2, 'H')
                    record[avg] = Math.round((parseFloat(ec?.[ec_avg]) / parseFloat(ec?.[ec_ival_tot])) * parseFloat(record?.[ival_tot]))
                    record[avg_f] = setCharAt(record?.[avg_f], 2, 'H')
                    record[std] = Math.round((parseFloat(ec?.[ec_std]) / parseFloat(ec?.[ec_ival_tot])) * parseFloat(record?.[ival_tot]))
                    record[std_f] = setCharAt(record?.[std_f], 2, 'H')
                    record[othnl] = Math.round(parseFloat(record?.[ival_tot]) -
                        (
                            parseFloat(record?.[lifo]) + parseFloat(record?.[fifo]) + parseFloat(record?.[avg]) + parseFloat(record?.[std])
                        ))
                    record[othnl_f] = setCharAt(record?.[othnl_f], 2, 'H')
                    msg.mivDetail='Route C'
                }
            } else {
                    msg.mivDetail='Call NonLifo Valuation'
            }
        } else if (parseFloat(INVVSUMx) == 0) {
            if (parseFloat(record?.[lifo]) == parseFloat(record?.[ival_tot])) {
                    msg.mivDetail='Route A'
            } else {
                record[lifo] = record?.[ival_tot]
                flagRules(lifo, [ival_tot_f])
                    msg.mivDetail='Route A'
            }
        } else {
            record[fifo] = Math.round((parseFloat(record?.[fifo]) / parseFloat(INVVSUMx)) * parseFloat(INVDIFFx))
            record[fifo_f] = setCharAt(record?.[fifo_f], 2, 'K')

            record[avg] = Math.round((parseFloat(record?.[avg]) / parseFloat(INVVSUMx)) * parseFloat(INVDIFFx));
            record[avg_f] = setCharAt(record?.[avg_f], 2, 'K');

            record[std] = Math.round((parseFloat(record?.[std]) / parseFloat(INVVSUMx)) * parseFloat(INVDIFFx));
            record[std_f] = setCharAt(record?.[std_f], 2, 'K');

            record[othnl] = Math.round(parseFloat(record?.[ival_tot]) - (parseFloat(record?.[lifo]) + parseFloat(record?.[fifo]) + parseFloat(record?.[avg]) + parseFloat(record?.[std])));
            record[othnl_f] = setCharAt(record?.[othnl_f], 2, 'K');

            msg.mivDetail='Route C'
        }
    }
    function EvaluateDetailValuationMethodsModule() {
        let letter = msg.miv
        msg.mivDetail=''
        EvaluateDetailValuationMethods(letter)
    }
    EvaluateDetailValuationMethodsModule()
    return msg
}catch(e){
    msg.err='Exit Edit'
    msg.payload.exit = 'MIV Evaluate Detail'
    return msg
}

