    let cache = global.get("lookupCache");
    let naics_napcs = cache.data.find(
        item =>
            item.module === "mfg_napcs" &&
            item.param === 'mfg_napcs' &&
            item.program === "aies" &&
            item.unit_type === "all"
    )?.json_values;

    function sumRow(newobj) {
        var naicsNapcs = naics_napcs['MN_NAPCS_BL_GROUPS']
        var keys = [];
        for (let i in naicsNapcs) {
            let data = naicsNapcs[i]
            let sum = null;
            let naics = data['NAICS']
            for (var key in data) {
                if (key.startsWith('NAPCS_BL_') && data[key] != null) {
                    let variable = data[key]
                    if (newobj?.[variable]) {
                        if (!Number.isNaN(parseFloat(newobj[variable]))) {
                            if (sum == null) {
                                sum = parseFloat(newobj[variable])
                            } else {
                                sum = parseFloat(sum) + parseFloat(newobj[variable])
                            }
                        }
                    }
                }
            }
            if (sum != null) {
                keys.push({ naics, sum })
            }
        }
        return keys;
    }

    function finalCheckMFGNAICS() {
        if (record.NAICS_CODE == record.NAICS_DERIVED) {
        } else {
            record.REFERRAL_FLAG = 'NAICS_DERIVED_DIFF'
            record.NAPCS_IND = 'N'
        }
    }

    let id = record?.REPORTING_ID
    let allData = msg.payload.csv;
    let newobj = {}
    for (let i in allData) {
        let row = allData[i]
        if (row.REPORTING_ID == id) {
            if (row?.PROD_CODE) {
                if (!['I', 'D', 'X'].includes(row?.USABLE)) {
                    let name = row?.PROD_CODE
                    newobj[name] = row?.PROD_CODE_VAL
                }
            }
        }
    }
    let dataArr = sumRow(newobj)
    const max = Math.max(...dataArr.map(o => o.sum), 0);
    let maxArr = dataArr.filter((d) => { return d.sum == max; });

    if (maxArr.length == 1) {
        record.NAICS_DERIVED = maxArr[0].naics
        finalCheckMFGNAICS()
    } else if (maxArr.length > 1) {
        let isNaics = maxArr.some(element =>
            element.naics == record?.NAICS_CODE);
        if (isNaics) {
            record.NAICS_DERIVED = record.NAICS_CODE
        } else {
            record.NAICS_DERIVED = maxArr[0].naics
        }
        finalCheckMFGNAICS()
    } else {
        record.NAICS_DERIVED = ' '
        record.NAPCS_IND = 'N'
    }

    record.ACTION = 'Return to Derive NAICS Code'
    return msg;
} catch (e) {
    global.set('err','Exit Edit')
    msg.payload.exit = 'Derive MFG NAICS'
    return msg;
}

