const findChangedKeyValuePairs = (oldObj, newObj) => {
  const changedKeyValuePairs = [];

  for (const key in newObj) {
    if (oldObj[key] !== newObj[key]) {
      changedKeyValuePairs.push({
        key,
        oldValue: oldObj[key],
        newValue: newObj[key],
        service: {
          name: 'qflow',
          timestamp: new Date()
        }
      });
    }
  }
  return changedKeyValuePairs;
}

