const formatUpdateQueryFromMessage = (messageObject) => {
  const { destinationTable } = getCurrentStepData(messageObject);
  let query = `UPDATE ${destinationTable} SET `;
  query += `results = '${escapeForSQL(JSON.stringify(messageObject))}'::jsonb, `;
  query += `facts = '${escapeForSQL(JSON.stringify(messageObject.fact))}'::jsonb, `;
  query += `delta = '${escapeForSQL(JSON.stringify(messageObject.delta))}'::jsonb `;
  query += `WHERE id = '${messageObject.meta.id}';`;
  return query;
};
const getCurrentStepData = (formattedJSON) => {
