  return formattedJSON.recipe.steps[currentStepIndex];
};
const escapeForSQL = (jsonString) => {
  return jsonString.replaceAll("'", "''");
};

const getChangeObjectFromDelta = (deltaList) =>
  deltaList.reduce((acc, curr) => {
    acc[curr.key] = curr.newValue;
    return acc;
  }, {});

const getDeltaFromMessage = (messageObject) => {
  return messageObject.delta || [];
};
const getOriginalFact = (formattedJSON) => {
  return formattedJSON.origFact;
};
const getKeyListOriginalFact = (origFact) => {
  return Object.keys(origFact);
};
const generateKeyValString = (changeObject) =>
  Object.entries(changeObject).map(([key, value]) => {
    let formattedValue;

    if (typeof value === 'string') {
      formattedValue = `'${value.replaceAll("'", "''")}'`;
    } else if (typeof value === 'number' || typeof value === 'boolean') {
      formattedValue = value;
    } else if (typeof value === 'object' && value !== null) {
      formattedValue = `'${JSON.stringify(value).replaceAll("'", "''")}'`;
    } else {
      formattedValue = value;
    }

    return `${key} = ${formattedValue}`;
  });

const formatDBUpdateQueryFromMessage = (messageObject, tableName, updateMatch) => {
  const changeObject = getChangeObjectFromDelta(getDeltaFromMessage(messageObject));
  const whereClause = updateMatch
  const origFact = getOriginalFact(messageObject);
  const origFactKeyList = getKeyListOriginalFact(origFact);
  for (const key in changeObject) {
    // Check if key is in the original fact
    if (!origFactKeyList.includes(key)) {
      // // If not, add it to the original fact
      // console.info(
      //   `Job Output | Detected new key ${key} with value ${changeObject[key]} for job ${messageObject.job.jobName} where update query is ${whereClause}`
      // );
      delete changeObject[key];
      continue;
    }

    // If original fact value is null, or
    // If changeObject value is null, skip
    // Because null cannot determine the type
    if (origFact[key] == null || changeObject[key] == null) {
      continue;
    }

    if (typeof changeObject[key] !== typeof origFact[key]) {
      // console.info(
      //   `Job Output | Detected invalid value type for ${key} with value ${changeObject[key]
      //   } | ${typeof changeObject[key]} where original value was ${origFact[key]
      //   } | ${typeof origFact[key]} for job ${messageObject.job.jobName
      //   } where update query is ${whereClause}`
      // );
      delete changeObject[key];
    }
  }

  if (Object.keys(changeObject).length === 0) {
    return;
  }

  let query = `UPDATE ${tableName} SET `;
  query += generateKeyValString(changeObject).join(', ');
  query += ` WHERE ${whereClause};`;
  return query;
};

